[{"location":"pages/highLevelDesign/#High-Level-Design","page":"High Level Design","title":"High Level Design","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"In this section definition for the main objects in this package are presented as well as an introduction to the main logic behind the structure of the package.","category":"page"},{"location":"pages/highLevelDesign/#Objects","page":"High Level Design","title":"Objects","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"In this section we will describe the objects present in the package, some are related to physical and financial entities found in the real world. To ensure our definitions well aligned with the financial we leverage most of the definitions from well established financial entities and/or acadamic sources. In particular IG International Limited: Glossary of Trading Terms is substantially used to support our definitions.","category":"page"},{"location":"pages/highLevelDesign/#Financial-Entitities:","page":"High Level Design","title":"Financial Entitities:","text":"","category":"section"},{"location":"pages/highLevelDesign/#Investor","page":"High Level Design","title":"Investor","text":"","category":"section"},{"location":"pages/highLevelDesign/#Broker","page":"High Level Design","title":"Broker","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: A broker is an independent person or a company that organises and executes financial transactions on behalf of another party. They can do this across a number of different asset classes, including stocks, forex, real estate and insurance. A broker will normally charge a commission for the order to be executed. Some brokers will provide you with market data and give you advice on the products you want to buy or sell – depending on whether they are a full service broker, or execution only. However, a broker must be licensed to give advice and execute the sale, and they will only perform trades on your behalf once you have given them the go-ahead.","category":"page"},{"location":"pages/highLevelDesign/#Market","page":"High Level Design","title":"Market","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: A financial market is defined as a medium through which assets are traded, enabling buyers and sellers to interact and facilitate exchanges. However, the term can be used in a variety of different ways – it can refer physical places, virtual exchanges or groups of people that are interested in making transactions.","category":"page"},{"location":"pages/highLevelDesign/#Financial-constructs-and-instruments","page":"High Level Design","title":"Financial constructs and instruments","text":"","category":"section"},{"location":"pages/highLevelDesign/#Currency","page":"High Level Design","title":"Currency","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Investopedia definition  Currency is a medium of exchange for goods and services. In short, it's money, in the form of paper and coins, usually issued by a government and generally accepted at its face value as a method of payment.","category":"page"},{"location":"pages/highLevelDesign/#Asset","page":"High Level Design","title":"Asset","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: An asset is an economic resource which can be owned or controlled to return a profit, or a future benefit. In financial trading, the term asset relates to what is being exchanged on markets, such as stocks, bonds, currencies or commodities.","category":"page"},{"location":"pages/highLevelDesign/#Spread","page":"High Level Design","title":"Spread","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: In finance, the spread is the difference in price between the buy (bid) and sell (offer) prices quoted for an asset.","category":"page"},{"location":"pages/highLevelDesign/#Position","page":"High Level Design","title":"Position","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: A position is the expression of a market commitment, or exposure, held by a trader. It is the financial term for a trade that is either currently able to incur a profit or a loss – known as an open position – or a trade that has recently been cancelled, known as a closed position. Profit or loss on a position can only be realised once it has been closed.","category":"page"},{"location":"pages/highLevelDesign/#Option","page":"High Level Design","title":"Option","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: An option is a financial instrument that offers you the right – but not the obligation – to buy or sell an asset when its price moves beyond a certain price with a set time period.","category":"page"},{"location":"pages/highLevelDesign/#Portfolio","page":"High Level Design","title":"Portfolio","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited: A portfolio refers to group of assets that are held by a trader or trading company. Assets in a portfolio can come in many forms, including stocks, bonds, commodities or derivatives.","category":"page"},{"location":"pages/highLevelDesign/#Technical-Objects","page":"High Level Design","title":"Technical Objects","text":"","category":"section"},{"location":"pages/highLevelDesign/#Simulations-and-Backtesting","page":"High Level Design","title":"Simulations and Backtesting","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"In this section we will describe different calculations and methods used for the backtesting or simulation of a strategy.","category":"page"},{"location":"pages/highLevelDesign/#Portfolio-calculations-/-Financial-reports","page":"High Level Design","title":"Portfolio calculations / Financial reports","text":"","category":"section"},{"location":"pages/highLevelDesign/#Returns","page":"High Level Design","title":"Returns","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited:  Rate of return (ROR) is the loss or gain of an investment over a certain period, expressed as a percentage of the initial cost of the investment. A positive ROR means the position has made a profit, while a negative ROR means a loss. You will have a rate of return on any investment you make.","category":"page"},{"location":"pages/highLevelDesign/#PnL:-Profit-and-Losses","page":"High Level Design","title":"PnL: Profit and Losses","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"High Level Design","title":"High Level Design","text":"Definition from IG International Limited:  A profit and loss (P&L) statement is a financial report that provides a summary of a company’s revenue, expenses and profit. It gives investors and other interested parties an insight into how a company is operating and whether it has the ability to generate a profit.","category":"page"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"CurrentModule = AirBorne","category":"page"},{"location":"pages/autodocs/#Automated-Documentation","page":"Autodocs","title":"Automated Documentation","text":"","category":"section"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"Welcome to the documentation for AirBorne!","category":"page"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"This are the autodocs generated by Documenter.jl. ","category":"page"},{"location":"pages/autodocs/#Index","page":"Autodocs","title":"Index","text":"","category":"section"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"","category":"page"},{"location":"pages/autodocs/#Autodocs","page":"Autodocs","title":"Autodocs","text":"","category":"section"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"Modules = [AirBorne]","category":"page"},{"location":"pages/autodocs/#AirBorne.hello_world-Tuple{}","page":"Autodocs","title":"AirBorne.hello_world","text":"hello_world()\n\nReturns a string saying \"Hello World!\".\n\n\n\n\n\n","category":"method"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = AirBorne","category":"page"},{"location":"#AirBorne","page":"Home","title":"AirBorne","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Welcome to the documentation for AirBorne!","category":"page"},{"location":"","page":"Home","title":"Home","text":"In this documentation you will find descriptions for the methods of the package, reasoning and sources for our high-level design and examples showing how this package can be leveraged. ","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"}]
